import { React } from 'react';
import './App.css';

const Digimon = (props) => {
    return(
    <div className="digiCard">
        <div className="name">{props.name}</div>
        <div className="level">Nivel: {props.level}</div>
        <div className="img" src={props.img} alt="" />
    </div>
    )
}

export default Digimon;
